{"align":"Right","attr":"set","prompt":"","src":"var svg = d3.select(thisobj);
 svg.selectAll("*").select(function(d, i) { return i > 1 ? this : null; }).remove();
 var cnt = 1;
 var x = svg[0][0].getBBox().x;
 var y = svg[0][0].getBBox().y + svg[0][0].getBBox().height;
 for(var tag in NPTS)
 {
 svg.append("text")
 .attr("x", x)
 .attr("y", y+cnt*30)
 .attr("fill", "red")
 .attr("font-family", "tahoma")
 .attr("font-size", "26px")
 .text(tag + " " + $V(tag) + " " + ((tag.indexOf('@')==0)? $W.getDescription(tag) : "") );
 cnt++;
 }","tag":"#exec_on_update","type":"Data"}

